// src/components/sections/Skills.jsx
import React, { useState } from "react";
import { useTheme } from "../../context/ThemeContext";

const Skills = () => {
  const { darkMode } = useTheme();
  const [activeCategory, setActiveCategory] = useState("frontend");

  // Donn√©es des comp√©tences
  const skillCategories = {
    frontend: {
      title: "Frontend Development",
      icon: "üé®",
      skills: ["React.js", "Vue.js", "JavaScript", "TypeScript", "HTML5/CSS3", "Tailwind CSS", "Responsive Design"],
      description: "Conception d'interfaces utilisateur modernes et r√©actives avec les technologies web les plus r√©centes."
    },
    backend: {
      title: "Backend Development",
      icon: "‚öôÔ∏è",
      skills: ["Node.js", "Python", "SQL", "NoSQL", "RESTful APIs", "GraphQL", "Express.js", "Django"],
      description: "D√©veloppement de services robustes et √©volutifs avec une infrastructure backend solide et performante."
    },
    tools: {
      title: "Tools & Methods",
      icon: "üõ†Ô∏è",
      skills: ["Git/GitHub", "Docker", "CI/CD", "Agile/Scrum", "Jest", "Cypress", "Webpack", "Vite"],
      description: "Utilisation d'outils et de m√©thodologies qui optimisent le flux de travail et garantissent des livrables de qualit√©."
    }
  };

  return (
    <section
      id="skills"
      className="section-content min-h-screen flex items-center justify-center p-8 py-24"
    >
      <div className="max-w-7xl mx-auto px-6 reveal" style={{ transformStyle: 'preserve-3d' }}>
        <div className="text-center mb-20">
          <h2 className={`text-4xl font-bold mb-4 ${darkMode ? "text-white" : "text-gray-800"}`}>
            Expertise
          </h2>
          <p
            className={`max-w-2xl mx-auto ${
              darkMode ? "text-gray-400" : "text-gray-600"
            }`}
          >
            Fort d'une expertise technique approfondie et d'un sens aigu du
            design, je d√©veloppe des applications web modernes et
            performantes.
          </p>
        </div>

        {/* Navigation des cat√©gories */}
        <div className="flex flex-wrap justify-center gap-4 mb-12">
          {Object.entries(skillCategories).map(([key, category]) => (
            <button
              key={key}
              onClick={() => setActiveCategory(key)}
              className={`px-6 py-3 rounded-lg text-base sm:text-lg font-medium transition-all duration-300 ${
                activeCategory === key
                  ? darkMode
                    ? "bg-gray-800 text-white shadow-lg border-2 border-blue-500"
                    : "bg-white text-gray-900 shadow-lg border-2 border-blue-500"
                  : darkMode
                    ? "bg-gray-900/50 text-gray-400 hover:text-gray-300 border-2 border-transparent"
                    : "bg-white/80 text-gray-700 hover:text-gray-900 border-2 border-transparent"
              }`}
            >
              <span className="mr-2">{category.icon}</span>
              {category.title}
            </button>
          ))}
        </div>

        {/* Affichage des comp√©tences */}
        <div className={`p-8 rounded-xl ${
          darkMode ? "bg-gray-800/80 shadow-xl" : "bg-white shadow-xl"
        }`}>
          <div className="flex flex-col md:flex-row items-start gap-8">
            <div className="md:w-1/3">
              <h3 className={`text-2xl font-bold mb-4 ${
                darkMode ? "text-white" : "text-gray-800"
              }`}>
                {skillCategories[activeCategory].title}
              </h3>
              <p className={`mb-6 ${
                darkMode ? "text-gray-300" : "text-gray-600"
              }`}>
                {skillCategories[activeCategory].description}
              </p>
              <div className={`p-4 rounded-lg ${
                darkMode ? "bg-gray-700/50" : "bg-gray-100"
              }`}>
                <p className={`italic ${
                  darkMode ? "text-gray-300" : "text-gray-600"
                }`}>
                  {activeCategory === "frontend" && "Les technologies frontend √©voluent rapidement - je reste constamment √† jour avec les derniers frameworks et outils."}
                  {activeCategory === "backend" && "Une architecture backend solide est essentielle pour des applications performantes, s√©curis√©es et √©volutives."}
                  {activeCategory === "tools" && "L'utilisation des bons outils permet d'optimiser le workflow de d√©veloppement et d'assurer une qualit√© constante."}
                </p>
              </div>
            </div>

            <div className="md:w-2/3 grid grid-cols-1 sm:grid-cols-2 lg:grid-cols-3 gap-4">
              {skillCategories[activeCategory].skills.map((skill, index) => (
                <div 
                  key={index} 
                  className={`p-4 rounded-lg transition-all duration-300 transform hover:-translate-y-1 flex items-center ${
                    darkMode
                      ? "bg-gray-700 hover:bg-gray-700/80 shadow"
                      : "bg-gray-50 hover:bg-blue-50 shadow-md"
                  }`}
                >
                  <div className={`w-2 h-2 rounded-full mr-3 ${
                    darkMode ? "bg-blue-400" : "bg-blue-500"
                  }`}></div>
                  <span className={`font-medium ${
                    darkMode ? "text-white" : "text-gray-800"
                  }`}>{skill}</span>
                </div>
              ))}
            </div>
          </div>
        </div>
      </div>
    </section>
  );
};

export default Skills;
